import React from 'react';
import './App.css';
import Login from './Login';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <div className="App-content">
        <Login />
      </div>      
      <footer className="App-footer">
      </footer>
    </div>
  );
}

export default App;
